import { Link } from 'react-router-dom';
import 'materialize-css/dist/css/materialize.min.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <h2>BookMarker</h2>
            <div className = 'links' >
                <Link to="/">Home</Link>
                <Link to="/search" >Search</Link>
                <Link to="/saved" >Save</Link>
            </div>
        </nav>
      );
}

export default Navbar;
